import React, { useState } from 'react';
import PopupNavigation from './PopupNavigation'; // Assurez-vous d'importer le composant de navigation

function PopupApp() {
  const [isPopupOpen, setPopupOpen] = useState(false);

  const openPopup = () => {
    setPopupOpen(true);
  };

  const closePopup = () => {
    setPopupOpen(false);
  };

  return (
    <div>
      <button onClick={openPopup}>Ouvrir la popup de navigation</button>
      {isPopupOpen && (
        <div className="popup">
          <div className="popup-content">
            <PopupNavigation closePopup={closePopup} />
          </div>
        </div>
      )}
    </div>
  );
}

export default PopupApp;
